css_rules.cssText:
@media (max-width: 768px) {
  #menu { display: block; }
  header .navbar { position: fixed; top: 6.5rem; right: -120%; width: 75%; height: 100%; text-align: left; align-items: flex-start; background-color: rgb(14, 15, 49); }
  header .navbar ul { flex-flow: column; padding: 1rem; }
  header .navbar ul li { text-align: center; margin: 1rem 0px; border-radius: 0.5rem; width: 26rem; }
  header .navbar ul li a { display: block; padding: 1rem; text-align: left; color: rgb(255, 255, 255); font-size: 2rem; }
  header .navbar ul li a.active, header .navbar ul li a:hover { padding: 1rem; color: rgb(255, 255, 255); border-radius: 0.5rem; border-bottom: 0.5rem solid rgb(1, 26, 255); }
  .fa-times { transform: rotate(180deg); }
  header .navbar.nav-toggle { right: 0px; }
}

@media (max-width: 450px) {
  .home .btn { margin: 4rem 0px; }
  .socials { margin-top: 12rem; }
  .home .image img { margin-top: -12rem; }
  .home .content p { font-size: 2.2rem; }
  .home .content p span { font-size: 2.2rem; }
}

@media screen and (max-width: 600px) {
  .about .row .image { margin-top: 2rem; }
  .about .row .image img { margin: 0px auto; width: 80%; mix-blend-mode: normal; }
  .about .row { padding: 0.5rem; margin-bottom: 7rem; }
  .about .row .content { padding: 1rem; }
  .about .row .content .box-container { gap: 0px; }
}

@media screen and (max-width: 600px) {
  .skills .container { padding: 0px; margin: 0px; }
  .skills .container .row { grid-template-columns: repeat(2, 1fr); margin: 1rem; padding: 2rem 0.2rem; gap: 1rem; }
  .skills .container { margin-top: 5px; width: 100%; }
}

@media screen and (max-width: 600px) {
  .education .box-container .box { flex-direction: column; width: 100%; }
  .education .box-container .box .image { width: 100%; height: 25rem; }
  .education .box-container .box img { width: 100%; }
  .education .box-container .box .content { position: relative; display: flex; flex-flow: column wrap; padding: 1rem; flex: 0 1 0%; }
  .education .btns { margin-top: 2rem; margin-left: 1rem; margin-right: 1rem; flex-wrap: wrap; }
}

@media screen and (max-width: 600px) {
  .experience { min-height: 80vh; }
  .experience .timeline { margin-top: 2rem; }
  .experience .timeline::after { left: 31px; }
  .experience .container { width: 100%; padding-left: 8rem; padding-right: 2rem; }
  .experience .container::after { font-size: 2.2rem; }
  .experience .container::before { left: 61px; border-style: solid; border-image: initial; border-width: 10px 10px 10px 0px; border-color: transparent rgb(246, 140, 9) transparent transparent; }
  .experience .left::after { left: 15px; }
  .experience .right::after { left: 15px; }
  .experience .right { left: 0%; }
  .morebtn { margin-top: 3rem; }
}

@media (max-width: 900px) {
  .contact { min-height: 70vh; }
  .contact .container { margin: 3rem 0px 2rem; }
  .contact .container .content { padding: 18px 12px; }
  .contact .content .image-box { display: none; }
  .contact .content form { width: 100%; margin-right: 2rem; }
}

@media (max-width: 450px) {
  html { font-size: 55%; }
  body { padding-right: 0px; }
  section { padding: 2rem; }
}

@keyframes tawkMaxOpen { 
  0% { opacity: 0; transform: translate(0px, 30px); }
  100% { opacity: 1; transform: translate(0px, 0px); }
}

@-webkit-keyframes tawkMaxOpen { 
  0% { opacity: 0; transform: translate(0px, 30px); }
  100% { opacity: 1; transform: translate(0px, 0px); }
}

@keyframes tawkMaxClose { 
  0% { opacity: 1; transform: translate(0px, 0px); }
  100% { opacity: 0; transform: translate(0px, 30px); }
}

@-webkit-keyframes tawkMaxClose { 
  0% { opacity: 1; transform: translate(0px, 0px); }
  100% { opacity: 0; transform: translate(0px, 30px); }
}
